/*Table structure for table `timer_counter` */

DROP TABLE IF EXISTS `timer_counter`;

CREATE TABLE `timer_counter` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `module_id` int(11) unsigned NOT NULL,
  `counter` int(4) DEFAULT NULL COMMENT 'Counter',
  `timer_1` int(4) DEFAULT NULL COMMENT 'Confirm Timer',
  `timer_2` int(4) DEFAULT NULL COMMENT 'Resend Timer',
  `timer_3` int(4) DEFAULT NULL COMMENT 'Report Timer',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `module_id` (`module_id`),
  CONSTRAINT `timer_counter_ibfk_1` FOREIGN KEY (`module_id`) REFERENCES `modules` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=185 DEFAULT CHARSET=utf8;

